template<bool use_default_constructor> struct swap_selector;
template<>
struct swap_selector<true>
{
    template<class T>
    static void optional_swap ( optional<T>& x, optional<T>& y )
    {
        const bool hasX = !!x;
        const bool hasY = !!y;
        if ( !hasX && !hasY )
            return;
        if( !hasX )
            x = boost::in_place();
        else if ( !hasY )
            y = boost::in_place();
        boost::swap(x.get(),y.get());
        if( !hasX )
            y = boost::none ;
        else if( !hasY )
            x = boost::none ;
    }
};
template<>
struct swap_selector<false>
{
    template<class T>
    static void optional_swap ( optional<T>& x, optional<T>& y )
    {
        const bool hasX = !!x;
        const bool hasY = !!y;
        if ( !hasX && hasY )
        {
            x = y.get();
            y = boost::none ;
        }
        else if ( hasX && !hasY )
        {
            y = x.get();
            x = boost::none ;
        }
        else if ( hasX && hasY )
        {
            boost::swap(x.get(),y.get());
        }
    }
};
